import React from 'react';
import ReactDOM from 'react-dom';
import add from './Cal';
import calcu from './Cal';

ReactDOM.render(
    <>
        <ul>
            <li>The sum of two number is{ calcu.add(3,4)}</li>
            <li>The sub of two number is{ calcu.sub(3,4)}</li>
        </ul>
    </>,
    document.getElementById('root')
);
